import React from 'react';
import { BrowserRouter as Router, Route, Link, Switch } from 'react-router-dom';
import logo from './logo.svg';
import './App.css';
import HomeComponent from './HomeComponent';
import AboutComponent from './AboutComponent';
import ContactComponent from './ContactComponent';
import HeaderComponent from './HeaderComponent';
import NotFoundComponent from './NotFoundComponent';

function App() {
  return (
    <Router>
      <div className="container">
        <HeaderComponent></HeaderComponent>
        <Switch>
          <Route exact path="/" component={HomeComponent}></Route>
          <Route
            exact
            path="/about-our-center"
            component={AboutComponent}
          ></Route>
          <Route exact path="/contact-us" component={ContactComponent}></Route>
          <Route component={NotFoundComponent}></Route>
        </Switch>
        <img src={logo} className="App-logo" alt="logo" />
        <div className="logo">
          <h1 className="logotitle">Center for Better Learning</h1>
          <h2 className="logotagline">
            Better Vision. <span className="logoyellow">Brighter</span> Future.
          </h2>
        </div>
      </div>
    </Router>
  );
}

export default App;
